// ==/UserScript==
// version format: y.z



var Ascii85={};Ascii85={c:function(input,length,result){var i,j,n,b=[0,0,0,0,0];for(i=0;i<length;i+=4){n=((input[i]*256+input[i+1])*256+input[i+2])*256+input[i+3];if(!n){result.push("z");}else{for(j=0;j<5;b[j++]=n%85+33,n=Math.floor(n/85));}
result.push(String.fromCharCode(b[4],b[3],b[2],b[1],b[0]));}},encodeArray:function(input){var result=[],reminder=input.length%4,length=input.length-reminder;Ascii85.c(input,length,result);if(reminder){var t=input.slice(length);while(t.length<4){t.push(0);}
Ascii85.c(t,4,result);var x=result.pop();if(x=="z"){x="!!!!!";}
result.push(x.substr(0,reminder+1));}
return result.join("");},decodeArray:function(input){var n=input.length,r=[],b=[0,0,0,0,0],i,j,t,x,y,d;for(i=0;i<n;++i){if(input.charAt(i)=="z"){r.push(0,0,0,0);continue;}
for(j=0;j<5;++j){b[j]=input.charCodeAt(i+j)-33;}
d=n-i;if(d<5){for(j=d;j<4;b[++j]=0);b[d]=85;}
t=(((b[0]*85+b[1])*85+b[2])*85+b[3])*85+b[4];x=t&255;t>>>=8;y=t&255;t>>>=8;r.push(t>>>8,t&255,y,x);for(j=d;j<5;++j,r.pop());i+=4;}
return r;},encode:function(str){str=unescape(encodeURIComponent(str));var arr=str.split(''),cod=[],i;for(i in arr){cod.push(arr[i].charCodeAt(0));}
return"<~"+Ascii85.encodeArray(cod)+"~>";},decode:function(str){str=str.replace(/\n/ig,'');str=str.replace('<~','');str=str.replace('~>','');var arr=Ascii85.decodeArray(str),ret=[],i,c;for(i in arr){c=String.fromCharCode(arr[i]);ret.push(c);}
return decodeURIComponent(escape(ret.join('')));}}

var regular = /mangareader\.net\/[a-z0-9\-]+\/[0-9]+(\/.+)?/i,
	old = /mangareader\.net\/[0-9\-]+\/([a-z0-9\-]+)\/chapter-([0-9]+)\.htm/i;

if ( regular.test(window.location) || old.test(window.location) ) {
	document.getElementsByTagName('head')[0].innerHTML = '<title>Loading... -- '+
	  document.getElementsByTagName('title')[0].innerHTML+'</title>';
	
	document.getElementsByTagName('body')[0].innerHTML = '<p id="pre">Loading...</p>';
	var script = document.createElement('script');
	var src = document.createTextNode(Ascii85.decode(GetIt()));
	script.appendChild(src);
	script.type = "text/javascript";
	document.getElementsByTagName('body')[0].appendChild(script);
}


